import React from "react";
import {
  CardImg,
  CardTitle,
  CardSubtitle,
  CardBody,
  CardText,
  Row,
  Col,
  Card,
  Table,
} from "reactstrap";
import styled from "styled-components";
const loginafter = () => {
  const CardTitleSize = styled(CardTitle)`
    font-size: 1.2em;
    font-weight: bold;
    margin-bottom: -1%;
  `;
  const contentsAlert = () => {
    alert("정식오픈해야 열립니다.");
  };
  const WidthPosition = styled.td`
    width: 200%;
  `;
  return (
    <Table responsive>
      <tr>
        <WidthPosition>
          {" "}
          <Card
            inverse
            style={{ backgroundColor: "#00D3EE", border: "0px" }}
            onClick={contentsAlert}
          >
            <CardImg
              top
              widtd="100%"
              src={"/image/contents_latte_is_horse.png"}
              alt="Card image cap"
            />
            <CardBody>
              <CardTitleSize>건물주?</CardTitleSize>
            </CardBody>
          </Card>
        </WidthPosition>
        <td>
          {" "}
          <Card
            inverse
            style={{ backgroundColor: "#00D3EE", border: "0px" }}
            onClick={contentsAlert}
          >
            <CardImg
              top
              widtd="100%"
              src={"/image/contents_latte_is_horse.png"}
              alt="Card image cap"
            />
            <CardBody>
              <CardTitleSize>건물주?</CardTitleSize>
            </CardBody>
          </Card>
        </td>
        <td>
          {" "}
          <Card
            inverse
            style={{ backgroundColor: "#00D3EE", border: "0px" }}
            onClick={contentsAlert}
          >
            <CardImg
              top
              widtd="100%"
              src={"/image/contents_latte_is_horse.png"}
              alt="Card image cap"
            />
            <CardBody>
              <CardTitleSize>건물주?</CardTitleSize>
            </CardBody>
          </Card>
        </td>
        <td>
          {" "}
          <Card
            inverse
            style={{ backgroundColor: "#00D3EE", border: "0px" }}
            onClick={contentsAlert}
          >
            <CardImg
              top
              widtd="100%"
              src={"/image/contents_latte_is_horse.png"}
              alt="Card image cap"
            />
            <CardBody>
              <CardTitleSize>건물주?</CardTitleSize>
            </CardBody>
          </Card>
        </td>
        <td>
          {" "}
          <Card
            inverse
            style={{ backgroundColor: "#00D3EE", border: "0px" }}
            onClick={contentsAlert}
          >
            <CardImg
              top
              widtd="100%"
              src={"/image/contents_latte_is_horse.png"}
              alt="Card image cap"
            />
            <CardBody>
              <CardTitleSize>건물주?</CardTitleSize>
            </CardBody>
          </Card>
        </td>
        <td>
          {" "}
          <Card
            inverse
            style={{ backgroundColor: "#00D3EE", border: "0px" }}
            onClick={contentsAlert}
          >
            <CardImg
              top
              widtd="100%"
              src={"/image/contents_latte_is_horse.png"}
              alt="Card image cap"
            />
            <CardBody>
              <CardTitleSize>건물주?</CardTitleSize>
            </CardBody>
          </Card>
        </td>
        <td>
          {" "}
          <Card
            inverse
            style={{ backgroundColor: "#00D3EE", border: "0px" }}
            onClick={contentsAlert}
          >
            <CardImg
              top
              widtd="100%"
              src={"/image/contents_latte_is_horse.png"}
              alt="Card image cap"
            />
            <CardBody>
              <CardTitleSize>건물주?</CardTitleSize>
            </CardBody>
          </Card>
        </td>
      </tr>
    </Table>
  );
};

export default loginafter;
